import React, { Component } from "react";
import { NotificationContainer, NotificationManager } from 'react-notifications';
import ProductService from './ProductService';
const productService = new ProductService();
class AddProduct extends Component {
  constructor(props) {
    super(props);
    this.state = {
      title : "",
      tag : "",
      category : "",
      descripition : "",
      image : "",
      price : "",
      compare_price : "",
      errors: {}
    };
  }
  handleForm = e => {
    e.preventDefault();
    const data = new FormData()

    data.append('title', this.state.title)
    data.append('tag', this.state.tag)
    data.append('category', this.state.category)
    data.append('descripition', this.state.descripition)
    data.append('image', this.state.image)
    data.append('price', this.state.price)
    data.append('compare_price', this.state.compare_price)

    // axios
    productService.createProduct(data).then(result => {
      console.log(result);
      NotificationManager.success("Product Added Sussceefully");
    })
    .catch(err => {
      if (err.response && err.response.status === 400)
        NotificationManager.error(err.response.data.msg);
      else
        NotificationManager.error("Something Went Wrong");
      this.setState({ errors: err.response })
    });
};
  handleInput = e => {
    e.preventDefault();
    const name = e.target.name;
    const value = e.target.value;
    this.setState({ [name]: value });
  };
  handleImage=e=>{
    e.preventDefault();
    this.setState({ image: e.target.files[0] });
  };
  render() {
    return (
      <div className="content">
        <NotificationContainer />
                <form onSubmit={this.handleForm}>


                </form>
            </div>
    );
  }
}


export default AddProduct;
